package api.stonedt.com.entity;

public class OtherHospital {
	private int id;
	private String hospitalname;
	private String level;
	private String website;
	private String microblog;
	private String logo;
	private int hospitalid;
	public OtherHospital() {
		super();
		// TODO Auto-generated constructor stub
	}
	public OtherHospital(int id, String hospitalname, String level, String website, String microblog, String logo,
			int hospitalid) {
		super();
		this.id = id;
		this.hospitalname = hospitalname;
		this.level = level;
		this.website = website;
		this.microblog = microblog;
		this.logo = logo;
		this.hospitalid = hospitalid;
	}
	@Override
	public String toString() {
		return "OtherHospital [id=" + id + ", hospitalname=" + hospitalname + ", level=" + level + ", website="
				+ website + ", microblog=" + microblog + ", logo=" + logo + ", hospitalid=" + hospitalid + "]";
	}
	public int getId() {
		return id;
	}
	public void setId(int id) {
		this.id = id;
	}
	public String getHospitalname() {
		return hospitalname;
	}
	public void setHospitalname(String hospitalname) {
		this.hospitalname = hospitalname;
	}
	public String getLevel() {
		return level;
	}
	public void setLevel(String level) {
		this.level = level;
	}
	public String getWebsite() {
		return website;
	}
	public void setWebsite(String website) {
		this.website = website;
	}
	public String getMicroblog() {
		return microblog;
	}
	public void setMicroblog(String microblog) {
		this.microblog = microblog;
	}
	public String getLogo() {
		return logo;
	}
	public void setLogo(String logo) {
		this.logo = logo;
	}
	public int getHospitalid() {
		return hospitalid;
	}
	public void setHospitalid(int hospitalid) {
		this.hospitalid = hospitalid;
	}
	
	

}
